import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { siteContent, userData } from '../data/data';
import { useAuth } from '../contexts/AuthContext';

const Profile = () => {
  const { profilePage } = siteContent;
  const { user, updateProfile } = useAuth();
  const [isEditing, setIsEditing] = useState(false);

  // Si pas d'utilisateur dans le contexte, utiliser les données statiques
  const profileUser = user || userData.currentUser;

  const [formData, setFormData] = useState({
    fullName: profileUser.fullName,
    email: profileUser.email,
    location: profileUser.location,
    phone: profileUser.phone,
    cuisine: profileUser.cuisine,
    dateOfBirth: profileUser.dateOfBirth
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (updateProfile) {
      await updateProfile(formData);
    }
    setIsEditing(false);
  };

  // Menu latéral des paramètres du profil
  const SettingsSidebar = () => (
    <div className="bg-black text-white w-64 min-h-full p-4">
      <div className="mb-8">
        <Link to="/" className="flex items-center space-x-2">
          <svg className="w-4 h-4" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 19l-7-7m0 0l7-7m-7 7h18" />
          </svg>
          <span>Back</span>
        </Link>
      </div>

      <h2 className="text-xl font-semibold mb-6">Account settings</h2>

      <nav>
        <ul className="space-y-4">
          {Object.entries(profilePage.navigation).map(([key, value]) => (
            <li key={key} className={`py-2 ${key === 'profileDetails' ? 'bg-gray-800 rounded-md px-2' : ''}`}>
              <Link to="#" className="flex items-center space-x-2">
                <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
                </svg>
                <span>{value}</span>
              </Link>
            </li>
          ))}
        </ul>
      </nav>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <div className="flex flex-1">
        <SettingsSidebar />

        <div className="flex-1 p-8">
          <div className="bg-white rounded-lg shadow p-6 max-w-3xl">
            <div className="flex justify-between items-center mb-6">
              <div>
                <h1 className="text-2xl font-bold">{profilePage.title}</h1>
                <p className="text-gray-600">{profilePage.subtitle}</p>
              </div>
              <div>
                <img
                  src={profileUser.avatar || profilePage.avatar}
                  alt="Profile"
                  className="w-16 h-16 rounded-full object-cover"
                />
              </div>
            </div>

            <form onSubmit={handleSubmit}>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div>
                  <label className="block text-gray-700 mb-2">Full name</label>
                  {isEditing ? (
                    <input
                      type="text"
                      name="fullName"
                      value={formData.fullName}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.fullName}</p>
                  )}
                </div>

                <div>
                  <label className="block text-gray-700 mb-2">Location</label>
                  {isEditing ? (
                    <input
                      type="text"
                      name="location"
                      value={formData.location}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.location}</p>
                  )}
                </div>

                <div>
                  <label className="block text-gray-700 mb-2">Email</label>
                  {isEditing ? (
                    <input
                      type="email"
                      name="email"
                      value={formData.email}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.email}</p>
                  )}
                </div>

                <div>
                  <label className="block text-gray-700 mb-2">Phone</label>
                  {isEditing ? (
                    <input
                      type="tel"
                      name="phone"
                      value={formData.phone}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.phone}</p>
                  )}
                </div>

                <div>
                  <label className="block text-gray-700 mb-2">Cuisine</label>
                  {isEditing ? (
                    <input
                      type="text"
                      name="cuisine"
                      value={formData.cuisine}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.cuisine}</p>
                  )}
                </div>

                <div>
                  <label className="block text-gray-700 mb-2">Date of birth</label>
                  {isEditing ? (
                    <input
                      type="text"
                      name="dateOfBirth"
                      value={formData.dateOfBirth}
                      onChange={handleChange}
                      className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-200"
                    />
                  ) : (
                    <p className="text-lg">{profileUser.dateOfBirth}</p>
                  )}
                </div>
              </div>

              <div className="mt-8">
                {isEditing ? (
                  <div className="flex space-x-4">
                    <button
                      type="submit"
                      className="bg-black text-white px-6 py-2 rounded-md hover:bg-gray-800"
                    >
                      Save
                    </button>
                    <button
                      type="button"
                      onClick={() => setIsEditing(false)}
                      className="border border-gray-300 px-6 py-2 rounded-md hover:bg-gray-100"
                    >
                      Cancel
                    </button>
                  </div>
                ) : (
                  <button
                    type="button"
                    onClick={() => setIsEditing(true)}
                    className="bg-black text-white px-6 py-2 rounded-md hover:bg-gray-800"
                  >
                    Edit Profile
                  </button>
                )}
              </div>
            </form>
          </div>

          <div className="bg-black text-white rounded-lg shadow p-6 max-w-3xl mt-6">
            <div className="flex justify-between items-center">
              <div>
                <h2 className="text-xl font-bold">{profilePage.foodDiscover.title}</h2>
                <p className="text-gray-400 mt-2 max-w-md">
                  {profilePage.foodDiscover.description}
                </p>
              </div>
              <button className="bg-white text-black px-4 py-2 rounded-md hover:bg-gray-200">
                {profilePage.foodDiscover.button}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
